function Login() {
    return (
        <div>
            <h3>.WORKLOG</h3>
            <div>LOGIN</div>
            <div>아이디</div>
            <div className={styles.id}>
                <input></input>
            </div>
            <div>비밀번호</div>
            <div className={styles.password}>
                <input></input>
            </div>
        </div>
    );
}

export default Login;
